    [1263] = {2592,1,"最近虽然每天都在产生怪人，可是所有人都只拜托我，其他英雄好歹也是职业人物，拜托稍微拿出点战果来。",10375,11375,0,0,0,0,0,0,0,0,1,"pic/stagemap/7.png","0","0","0","0","0",},
